import React, { Component } from 'react';
import test from '../img/test.png';

class Intro extends Component {
  render() {
    return (
        <div className="intro">
            <h1>Hi, I'm Felice</h1>
            <p id="p1">an aspiring software developer.</p> 
            <img id="test" className="img" src={test} alt="test" />
        </div>
    );
  }
}

export default Intro;
